import React,{useState} from 'react';




const NavbarContent=()=>{
  const [item,setItem]=useState([
    {
      id:'1',
      name:""
    },
    {
      id:'2',
      name:""
    },
    {
      id:'3',
      name:""
    },
  ])
  
  return(
      <div className='navbar_content_head'>
          <h2>RIT</h2>
          <h2>RIS</h2>
          <h2>Experience</h2>
      </div>
  )
}

export default NavbarContent;
